import React from 'react';

const Header = () => (
  <header className="header">
    <img src="/path/to/your-photo.jpg" alt="Jordan Kelley" className="profile-photo" />
    <h1>Jordan Kelley</h1>
    <p>Software Engineering Student | Developer | Problem Solver</p>
  </header>
);

export default Header;
